import React from 'react'

const App = () => {
  return (
    <div style={{textAlign: 'center',marginTop: '30px'}}>
      <h1>Registration</h1>
      <div style={{marginTop:'30px'}}>
        <button type="button" class="btn btn-primary" style={{marginRight:'30px'}}>Create User</button>
        <button type="button" class="btn btn-primary" style={{marginLeft:'30px'}}>Users List</button>
      </div>
    </div>
  )
}

export default App
